import React from 'react';

const ResCard = ({result}) => {

    console.log(result)
    return (
        <section className="bg-brown">
            <div className="container">
                <div>
                    {result.result.map(it => {
                        return (
                            <div className="bg-test p-3 m-2" >
                                <h5>{it.question}</h5>
                                <p> Correct answer: {it.rightAnswer} </p>
                            </div>
                        )

                    })}
                </div>
            </div>
        </section>
    );
};

export default ResCard;
